import React, { useCallback } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { countPlusAction, countMinusAction } from '../redux/reducers/count';
import Layout from '../components/Layout';

const App = () => {
  const count = useSelector((state) => state.count);
  const dispatch = useDispatch();
  // console.log(count);
  // const minus = () => {
  //   dispatch(countMinusAction());
  // };
  // const plus = () => {
  //   dispatch(countPlusAction());
  // };
  return (
    <Layout>
      <form>
        <table border="1">
          <tr>
            <td>대여일자</td>
            <td>날짜 ~ 날짜</td>
            <td rowSpan="3">|</td>
            <td>검색항목</td>
            <td>차량번호input 검색어 입력 input</td>
            <td rowSpan="3">|</td>
            <td rowSpan="3">검사</td>
          </tr>
          <tr>
            <td>보험연령</td>
            <td>보험연령 input</td>
            <td>차량등급</td>
            <td>차량등급 input</td>
          </tr>
          <tr>
            <td>사용연료</td>
            <td>사용연료 input</td>
            <td>차량색상</td>
            <td>차량색상 input</td>
          </tr>
        </table>
      </form>
      <div>
        <div className="row_line" />
      </div>
      <div className="div_table_header">
        <div>차량번호</div>
        <div>차량모델</div>
        <div>차량색상</div>
        <div>차량연식</div>
        <div>차량등급</div>
        <div>연료</div>
        <div>보험 연령</div>
        <div>차량위치</div>
        <div>영업점</div>
      </div>
      <style jsx>
        {`
          table{
            width:100%;
            border-collapse:collapse;
          }
          table td{
            padding-left:calc(10px);
            padding-right:calc(10px);
          }
          .div_table_header{
            display:flex;
            align-items: stretch;
          }
          .div_table_header div{
            width:100%;
            padding-left:calc(10px);
            padding-right:calc(10px);
          }
          .row_line{
            margin:10px 0;
            width:100%;
            height:1px;
            background-color:#BDBDBD;
          }
        `}
      </style>
      {/* {count}
      <button type="button" onClick={minus}>-</button>
      <button type="button" onClick={plus}>+</button> */}
    </Layout>
  );
};

export default App;
